package MYPACKAGE;

public class LOGICALOPERATOR {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       int a=3,b=6,c=9;
       Boolean result;
       result=(a>b)||(c>a);
       System.out.println(result);
       result=(a>b)&&(c>a);
       System.out.println(result);
	}

}
